import React, { Component } from 'react'

const forgotStyle ={
  position: 'relative',
  top:'20px',
  left:'80px'
}

class Fpassword extends Component {
  render () {
    return(
      <div className="login-container">
      <button style ={forgotStyle}>Forgot Password</button>
      </div>
    )
  }
}

export default Fpassword
